import React from 'react';
import './LoginPage.css';

class LoginPage extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
        history: [{
            squares: Array(9).fill(null),
        }],
        stepNumber: 0,
        xIsNext: true,
        rollBackCount: 3,
    };
  }
  render() {
    return (
      <div id="login-page">
        <div class="login-container">
          <form class="login">

          </form>
          <form class="signup">

          </form>
          <form class="guest">

          </form>
          <div class="login-options">

          </div>
        </div>
      </div>
    );
  }
}

export default LoginPage;
